import Nav from "./pages/Nav";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./pages/Nav.css"
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Nav />
        <Routes>
          <Route path="/" element={<h1>Home-Page</h1>} />
          <Route path="/empolyee" element={<h1>Empolyees-Page</h1>} />
          <Route path="/" element={<h1>Login-Page</h1>} />
          <Route path="/" element={<h1>S-Page</h1>} />

      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
